import Footer from '../component/footer';
import Header from '../component/header';
import "./login.css";

class Ligin extends Component{
    render() {
      return  <div>
      <Header></Header>
      <div className="ligin_page">
        <div className="login_div">
            <label>用户名：</label><input type="text" className="username"></input>
            <label>密  码：</label><input type="text" className="password"></input>
            <button type="button" className="submit">提交</button>
        </div>
      </div>
      <Footer></Footer>
      </div>
    }
}

export default Ligin;
